import React from 'react';

function Home() {

	const Service=[
		{
            id:1,
			ServiceImg: require('../../assets/icon/plane.png'),
			ServiceTitle:'Software Development Service',
			ServiceBody: 'This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.',
			ServiceLast:'Last updated 3 mins ago',
						
		},
	]
	return <div className='container mx-auto'>
		
			<h1 className="text-xl font-bold text-center md:text-6xl mt-20 mb-8">Our Services</h1>
			<p className="text-center  md:text-2xl ">We determine to assist to grow your business & help to take it <br/> onwards.
				Everything
				that we do for the sake of
				our customers.</p>
		
		<div className=" grid grid-rows-2 justify-items-center  md:grid-cols-2 gap-10  mb-24 mt-40 ">

			{Service.map((x)=>

				<div
					className=" flex flex-col md:flex-row items-center  md:items-start    max-w-xl rounded-lg bg-white shadow-lg p-2 " k>
					<img src={x.ServiceImg} className="h-24 w-auto md:h-11  mt-8 " alt="" />
					<div className="p-6 text-center md:text-justify">
						<h5 className="text-gray-900 text-xl font-medium mb-2">{x.ServiceTitle}</h5>
						<p className="text-gray-700 text-base mb-4">
							{x.ServiceBody}
						</p>
						<p className="text-gray-600 text-xs">{x.ServiceLast}</p>
					</div>
				</div>

			)}

			

			
			
		
			
			
			






		</div></div>;
}

export default Home;
